/* プラグイン ここまで*/

$(function($) {

	$body = $("body");
	
	FastClick.attach(document.body);

	$('a.scroll').on('click', function() {
		var href= $(this).attr("href");
		var target = $(href == "#" || href == "" ? 'html' : href);
		$.smoothScroll({
			scrollTarget: target,
			beforeScroll:function() {
				$body.addClass('scrollNow');
			},
			afterScroll:function() {
				$body.removeClass('scrollNow');
			}
		});
		return false;
	});

});
